        if exams_day == 0:
            return True

        if day == exams_day:
            return False

        return day <= special_days[exams_day][0] - 1 or special_days[exams_day][0] <= day < special_days[exams_day][1]

    def find_schedule(exam_day: int) -> list:
        def backtrack(exam_day: int) -> list:
            res = []
            for i in range(1, m+1):
                if i == exam_day:
                    continue

                if is_valid(exam_day, i):
                    s, d, c = special_days[i]
                    if c > exam_day - s + 1:
                        res.append(c)

            return res

        return backtrack(exam_day)

    schedules = []
    for i in range(1, n+1):
        if is_valid(i, 1):
            schedules.append(find_schedule(i))

    if not schedules:
        return -1

    result = []
    for schedule in schedules:
        if not schedule:
            result.append(0)
        else:
            result.append(len(schedule) + 1)

    return''.join(map(str, result))

