            if not visited[v]:
                new_dist = dist + d
                if new_dist < distance[v]:
                    distance[v] = new_dist
                    prev[v] = u
                    heapq.heappush(heap, (new_dist, v))

    # Check if the diameter is less than d
    if distance[n - 1] < d:
