    def min_level(points: list) -> int:
        levels = {}
        for p in points:
            level = max(abs(p[0]), abs(p[1]))
            if level not in levels:
                levels[level] = set()
            levels[level].add(p)
        return min(levels.keys())

    def min_distance(points: list) -> int:
        min_level_points = points[min_level(points)]
        distances = {}
        for p in min_level_points:
            if p in distances:
                continue
            distances[p] = 0
            for q in points:
                if p == q:
                    continue
                distance = abs(p[0] - q[0]) + abs(p[1] - q[1])
                if distance < distances.get(q, float('inf')):
                    distances[q] = distance
        return min(distances.values())

    return str(min_distance(points))

