    def is_prefix_of_lexicographically_smaller(s1, s2):
        i = 0
        for c1, c2 in zip(s1, s2):
            if c1 > c2:
                return True
            if c1 < c2:
                i += 1
        return i == len(s1)

    distinct_substrings = count_distinct_substrings(s)
    if K > distinct_substrings:
        return ''

    # Find the K-th lexicographically smallest substring
