    for i in range(n - 3):
        for j in range(i + 3, n + 1):
            substr = ''.join(sorted(s[i:j]))
            if substr not in smallest_substrings:
                smallest_substrings.add(substr)
                if len(smallest_substrings) == K:
                    break

    for substr in smallest_substrings:
        if is_prefix_of_lexicographically_smaller(substr, s):
            return substr

    return ''

