        if len(d) == 1:
            return d[0]
        else:
            parent = min(d, key=lambda x: unlikeliness(d, x))
            return parent + '-' + build_tree(d.remove(parent))

    def unlikeliness(d: list, x: str) -> int:
        def find_index(s: str, t: str) -> int:
            for i in range(len(s)):
                if s[i]!= t[i]:
                    return i
            return len(s)

        return sum(find_index(d[i], x)!= find_index(d[j], x) for i in range(len(d)) for j in range(i+1, len(d)))

    def is_valid(x: str) -> bool:
        return all(x[i] == y[i] for i in range(len(x)) for j in range(i+1, len(y)))

    def find_parent(x: str, d: list) -> str:
        if x in d:
            return find_parent(x, d)
        else:
            return x

    def dfs(d: list, parent: str) -> tuple[list, int]:
        nonlocal min_unlikeliness
        tree = [parent]
        for i in range(len(d)):
            if d[i] not in tree and is_valid(parent + '-' + d[i]):
                tree.append(d[i])
                min_unlikeliness = min(min_unlikeliness, dfs(d, tree[-1])[1])
                if min_unlikeliness == 0:
