def solution(stdin: str) -> str:
    R, C = map(int, stdin.split()[0].split())
    puzzle = [[None] * C for _ in range(R)]

    for i in range(R):
        row = stdin.split()[i + 1]
        for j in range(C):
            if row[j]!= "#":
                puzzle[i][j] = row[j].lower()

    def backtrack(i, j, current_word):
        nonlocal puzzle, words
        if i == R:
            return current_word

        if puzzle[i][j] in current_word:
            return backtrack(i, j + 1, current_word)

        for k in range(C):
            if puzzle[i][k] is not None and k > j:
                current_word += puzzle[i][k]
                if len(current_word) >= 2:
                    words.append(current_word)
                backtrack(i + 1, k, current_word)
                current_word = current_word[:-1]

    words = []
    backtrack(0, 0, "")

    if not words:
        return None

    words.sort()
    return words[0]

def solution(stdin: str) -> str:
    a, b, c, d = map(int, stdin.split())

    def simplify(expr):
        def simplify_term(term):
            terms = []
            for factor in term:
                if factor == "?":
                    terms.append(factor)
                elif factor.isdigit():
                    terms.append(int(factor))
                elif len(factor) == 1 and factor in "+-*/":
                    terms.append(factor)
                elif factor == "(":
                    terms.append(factor)
                    open_brackets = 1
                    for i, c in enumerate(factor):
                        if c == "(":
                            open_brackets += 1
                        elif c == ")":
                            open_brackets -= 1
                            if open_brackets == 0:
                                break
                    terms.append(simplify_term(factor[:i]))
            return terms

        terms = simplify_term(expr)
        return " ".join(str(term) for term in terms)

    def valid_operators(expr):
        operators = {"+", "-", "*", "/"}
        for operator in expr:
            if operator in "+-*/":
                operators.discard(operator)
        return operators

    def solve(expr):
        simplified = simplify(expr)
        operators = valid_operators(simplified)
        for operator in operators:
            left, right = expr.split(operator)
            if operator == "+":
                result = int(left) + int(right)
            elif operator == "-":
                result = int(left) - int(right)
            elif operator == "*":
                result = int(left) * int(right)
            elif operator == "/":
                if int(right) == 0:
                    return "problems ahead"
                result = int(left) / int(right)
            simplified = left + operator + right
            if simplified == expr:
                return result
        return "problems ahead"

    expressions = ["{} {} {}".format(a, op, b) for op in "+-*/" for b in range(1, 10)]
    expressions.append("{} / {}".format(a, b))
    expressions.append("{} - {}".format(a, b))
    expressions.append("{} * {}".format(a, b))

    results = sorted(set(solve(expr) for expr in expressions if solve(expr)!= "problems ahead"))
    return "\n".join(results)

