        if direction == 0:
            return height - 1 >= index
        elif direction == 1:
            return height + 1 <= index
        elif direction == 2:
            return index - n >= height
        else:
            return index + n <= height

    def bfs(height: int, index: int, direction: int) -> int:
        queue = [(height, index, direction)]
        visited = set()
        min_height = float('inf')

        while queue:
            curr_height, curr_index, curr_direction = queue.pop(0)
            if (curr_height, curr_index) in visited:
                continue
            visited.add((curr_height, curr_index))

            if curr_height == 0 and curr_index == n * m - 1:
                return min_height

            if not jump_or_not(curr_height, curr_index, curr_direction):
                continue

            new_height = curr_height + 1 if curr_direction == 0 else curr_height - 1
            new_index = curr_index + (new_height - curr_height) * (curr_direction + 1)

            if new_height < min_height:
                min_height = new_height

            if curr_direction == 0:
                queue.append((new_height, new_index, 0))
            elif curr_direction == 1:
                queue.append((new_height, new_index, 1))
            elif curr_direction == 2:
                queue.append((new_height, new_index, 2))
            else:
                queue.append((new_height, new_index, 3))

        return min_height

    for i in range(m):
        for j in range(n):
            if heights[i][j] == 0:
                continue
            for direction in range(4):
                min_height = bfs(heights[i][j], i * n + j, direction)
                if min_height == heights[i][j]:
                    return str(min_height)

    return "0"

