        if x < 0 or x >= N or y < 0 or y >= M:
            return False
        return grid[x][y] == '0'

    def neighboring_valid(x: int, y: int, dir: str) -> bool:
        x_delta = 0
        y_delta = 0
        if dir == 'U':
            x_delta = -1
        elif dir == 'D':
            x_delta = 1
        elif dir == 'L':
            y_delta = -1
        elif dir == 'R':
            y_delta = 1
        return is_valid(x + x_delta, y + y_delta)

    def count_zones(x: int, y: int) -> int:
        zone_count = 1
        visited = set()
        visited.add((x, y))
        while True:
            if not neighboring_valid(x, y, 'U'):
                break
            if (x, y) not in visited:
                visited.add((x, y))
                zone_count += 1
                x += 1
            else:
                break
        return zone_count

