    end_x, end_y = N - 1, M - 1
    if not is_valid(start_x, start_y):
        return "NOT POSSIBLE"

    start_time = 0
    end_time = t * count_zones(start_x, start_y) + 1

    if start_time < end_time:
        return count_zones(start_x, start_y)
